import React, { useContext, useState, useEffect } from 'react';
import { InventoryContext } from '../context/InventoryContext';

const ProductManagement = () => {
  const { products, addProduct, updateProduct, deleteProduct } = useContext(InventoryContext);

  // State for managing the form inputs and product list
  const [localProducts, setLocalProducts] = useState(products);
  const [productForm, setProductForm] = useState({
    name: '',
    description: '',
    category: '',
    price: '',
    quantity: '',
  });
  const [isEditing, setIsEditing] = useState(false);
  const [editingProductId, setEditingProductId] = useState(null); // Track the product being edited

  // Sync localProducts state with products from the context
  useEffect(() => {
    setLocalProducts(products);
  }, [products]);

  // Handle form input changes
  const handleChange = (e) => {
    const { name, value } = e.target;
    setProductForm((prev) => ({ ...prev, [name]: value }));
  };

  // Handle form submission (Add or Update Product)
  const handleSubmit = (e) => {
    e.preventDefault();
    if (isEditing) {
      // Update existing product
      updateProduct({ id: editingProductId, ...productForm });
      setIsEditing(false); // Reset editing state
      setEditingProductId(null); // Clear editing product ID
    } else {
      // Add new product
      const productId = new Date().getTime().toString(); // Temporary ID for demonstration
      addProduct({ id: productId, ...productForm });
    }
    // Reset form after submission
    setProductForm({ name: '', description: '', category: '', price: 0, quantity: 0 });
  };

  // Handle Edit button click
  const handleEdit = (product) => {
    setProductForm(product);
    setIsEditing(true);
    setEditingProductId(product.id); // Set product ID for editing
  };

  // Handle Delete button click
  const handleDelete = (id) => {
    deleteProduct(id);
    setLocalProducts(localProducts.filter((product) => product.id !== id)); // Update local state after deletion
  };

  return (
    <div>
      <h1>Product Management</h1>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          name="name"
          value={productForm.name}
          onChange={handleChange}
          placeholder="Product Name"
          required
        />
        <input
          type="text"
          name="description"
          value={productForm.description}
          onChange={handleChange}
          placeholder="Description"
          required
        />
        <input
          type="text"
          name="category"
          value={productForm.category}
          onChange={handleChange}
          placeholder="Category"
          required
        />
        <input
          type="number"
          name="price"
          value={productForm.price}
          onChange={handleChange}
          placeholder="Price"
          required
        />
        <input
          type="number"
          name="quantity"
          value={productForm.quantity}
          onChange={handleChange}
          placeholder="Initial Quantity"
          required
        />
        <button type="submit">{isEditing ? 'Update Product' : 'Add Product'}</button>
      </form>

      <h2>Products</h2>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Description</th>
            <th>Category</th>
            <th>Price</th>
            <th>Quantity</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {localProducts.map((product) => (
            <tr key={product.id}>
              <td>{product.name}</td>
              <td>{product.description}</td>
              <td>{product.category}</td>
              <td>${product.price}</td>
              <td>{product.quantity}</td>
              <td>
                <button onClick={() => handleEdit(product)}>Edit</button>
                <button onClick={() => handleDelete(product.id)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ProductManagement;
